import React from "react";

const Contact = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Contact Us</h1>
      <p>Email: contact@jobportal.com</p>
      <p>Phone: +1 (123) 456-7890</p>
    </div>
  );
};

export default Contact;
